import React from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
    display: flex;
`

function Tabs () {
    return(
        <Wrapper>
            <p>Tab1</p>
            <p>Tab2</p>
            <p>Tab3</p>
        </Wrapper>
    )
}

export default Tabs
